var dataset = JSON.parse(json_data);

// Get unique column labels
var columnLabels = Object.keys(dataset[0]).filter(key => key !== 'date');

// Create dropdown options
var selectColumn = document.getElementById('selectColumn');
columnLabels.forEach(label => {
  var option = document.createElement('option');
  option.value = label;
  option.text = label;
  selectColumn.appendChild(option);
});

// Draw graph based on selected column
function drawGraph(selectedColumn) {
  var chartData = dataset.map(item => {
    return {
      x: new Date(item.date),
      y: item[selectedColumn]
    };
  }
  );

  // Chart initialization and configuration
  var chart = new CanvasJS.Chart('chartContainer', {
    animationEnabled: true,
    theme: 'light2',
    title: {
      text: 'Economic Data Over Time'
    },
    axisX: {
      valueFormatString: 'YYYY-MM-DD'
    },
    axisY: {
      title: selectedColumn
    },
    data: [{
      type: 'line',
      dataPoints: chartData
    }]
  });

  // Render the chart
  chart.render();
}

// Event listener for column selection
selectColumn.addEventListener('change', function() {
  var selectedColumn = this.value;
  drawGraph(selectedColumn);
});

// Initial graph rendering
var initialColumn = columnLabels[0]; // Select the first column by default
drawGraph(initialColumn);